pragma solidity >=0.6.0 <0.8.0;

import "@chainlink/contracts/src/v0.4/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/math/Math.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "./Ownable.sol";

interface IMarketplace1 {

     enum ProductState {
        NotDeployed,                // don't exist or removed
        Deployed                    // created or redeployed
    }

    enum Currency {
        DMT,                       // "token wei" (10^-18 GMT)
        USD                         // dollars (10^-18 USD)
    }

    function getProduct(bytes32 id) external view returns (string memory name, address owner, address beneficiary, uint pricePerSecond, Currency currency, ProductState state);
}

contract Marketplace is Ownable, IMarketplace1 {
    using SafeMath for uint256;
    bool public hold = false;
    IERC20 public digimart;
    IMarketplace1 marketplace;
    AggregatorV3Interface internal priceFeed;
    address public currencyUpdateAgent;
    address payable public _beneficiary;
    //uint public dmtPerUsd = 100000000000000000; //Exchange rates is formatted as 10^18, like ether = 0.1 DMT/USD.

    uint8 constant INTERNAL_PRICE_DECIMALS = 2;

    mapping (bytes32 => Product) public products;
    mapping(uint256 => StoreData) storeData;
    mapping(uint256 => address) productBalance;

    /// events
    event Holded();
    event Resumed();

    // product events
    event ProductCreated(address indexed owner, bytes32 indexed id, string name, address beneficiary, uint pricePerSecond, Currency currency);
    event ProductUpdated(address indexed owner, bytes32 indexed id, string name, address beneficiary, uint pricePerSecond, Currency currency);
    event ProductDeleted(address indexed owner, bytes32 indexed id, string name, address beneficiary, uint pricePerSecond, Currency currency);
    event ProductImported(address indexed owner, bytes32 indexed id, string name, address beneficiary, uint pricePerSecond, Currency currency);
    event ProductRedeployed(address indexed owner, bytes32 indexed id, string name, address beneficiary, uint pricePerSecond, Currency currency);
    event ProductOwnershipOffered(address indexed owner, bytes32 indexed id, address indexed to);
    event ProductOwnershipChanged(address indexed newOwner, bytes32 indexed id, address indexed oldOwner);
    event PurchaseSuccessful(address customer, uint amount);
    event Withdraw(uint256 amount);

    event PaymentRequiredUSD(uint256 paymentusd);
    event UsdToDmt(uint256 usd_wei);
    event Dmt(uint256 dmt_cost);



    // modifiers
    modifier onHold() {
        require(!hold || owner == msg.sender, "error_hold");
        _;
    }

    modifier onlyProductOwner(bytes32 productId) {
        (,address _owner,,,,) = getProduct(productId);
        require(_owner != address(0), "error_notFound");
        require(_owner == msg.sender || owner == msg.sender, "error_productOwnersOnly");
        _;
    }

    // Product registry
    struct Product {
        bytes32 id;
        string name;
        address owner;
        address beneficiary;  // account where revenue is directed to
        uint pricePerSecond;
        Currency priceCurrency;
        ProductState state;
        address newOwnerCandidate;
    }

     // stores data for a single product release
    struct StoreData {
        uint32 startPriceUsd;
        uint32 endPriceUsd;
        uint32 feesPerproductUsd;
        uint16 totalProductSupply;
        uint16 buybackPercent;
        uint256 startTimestamp;
        uint256 endTimestamp;
    }


    constructor(address digiMartTokenAddress) Ownable() public {
        _initialize(digiMartTokenAddress);
    }


    function reInitialize(address digiMartTokenAddress) public onlyOwner {
        _initialize(digiMartTokenAddress);
    }


    function _initialize(address digiMartTokenAddress) internal {
        digimart = IERC20(digiMartTokenAddress);
    }

    /**
     * get product details 
     */
    function getProduct(bytes32 id) public override view returns (string memory name, address owner, address beneficiary, uint pricePerSecond, Currency currency, ProductState state) {
        if (owner != address(0) || address(marketplace) == address(0))
            return (name, owner, beneficiary, pricePerSecond, currency, state);
        (name, owner, beneficiary, pricePerSecond, currency, state) = marketplace.getProduct(id);
        return (name, owner, beneficiary, pricePerSecond, currency, state);
    }

    function _getProductDetails(bytes32 productId) internal returns (bool imported){
        if(address(marketplace) == address(0)) { return false; }
        Product storage p = products[productId];
        if (p.id != 0x0) { return false; }
        (string memory _name, address _owner, address _beneficial, uint _pricePerSecond, IMarketplace1.Currency _priceCurrency, IMarketplace1.ProductState _state) = marketplace.getProduct(productId);
        if (_owner == address(0)) { return false; }
        p.id = productId;
        p.name = _name;
        p.owner = _owner;
        p.beneficiary = _beneficial;
        p.pricePerSecond = _pricePerSecond;
        p.priceCurrency = _priceCurrency;
        p.state = _state;
        emit ProductImported(p.owner, p.id, p.name, p.beneficiary, p.pricePerSecond, p.priceCurrency);
        return true;
    }


    /**
     * createProductProfile for listing
     */
    function createProductProfile(bytes32 id, string memory name, address beneficiary, uint pricePerSecond, Currency currency) public onHold {
        _createProductProfile(id, name, beneficiary, pricePerSecond, currency);
    }


    function _createProductProfile(bytes32 id, string memory name, address beneficiary, uint pricePerSecond, Currency currency) internal {
        require(id != 0x0, "error_nullProductId");
        require(pricePerSecond > 0, "error_freeProductsNotSupported");
        (,address _owner,,,,) = getProduct(id);
        require(_owner == address(0), "error_alreadyExists");
        products[id] = Product({
            id: id, 
            name: name, 
            owner: msg.sender, 
            beneficiary: beneficiary, 
            pricePerSecond: pricePerSecond,
            priceCurrency: currency,  
            state: ProductState.Deployed, 
            newOwnerCandidate: address(0)
            });
        emit ProductCreated(msg.sender, id, name, beneficiary, pricePerSecond, currency);
    }

    /**
    * Stop offering the product
    */
    function removeProduct(bytes32 productId) public onlyProductOwner(productId) {
        _getProductDetails(productId);
        Product storage p = products[productId];
        require(p.state == ProductState.Deployed, "error_notDeployed");
        p.state = ProductState.NotDeployed;
        emit ProductDeleted(p.owner, productId, p.name, p.beneficiary, p.pricePerSecond, p.priceCurrency);
    }

    /**
    * Return product to market
    */
    function redeployProduct(bytes32 productId) public onlyProductOwner(productId) {
        _getProductDetails(productId);
        Product storage p = products[productId];
        require(p.state == ProductState.NotDeployed, "error_mustBeNotDeployed");
        p.state = ProductState.Deployed;
        emit ProductRedeployed(p.owner, productId, p.name, p.beneficiary, p.pricePerSecond, p.priceCurrency);
    }

    /**
    * update product status 
    */
    function updateProduct(bytes32 productId, string memory name, address beneficiary, uint pricePerSecond, Currency currency, bool redeploy) public onlyProductOwner(productId) {
        require(pricePerSecond > 0, "error_freeProductsNotSupported");
        _getProductDetails(productId);
        Product storage p = products[productId];
        p.name = name;
        p.beneficiary = beneficiary;
        p.pricePerSecond = pricePerSecond;
        p.priceCurrency = currency;
        emit ProductUpdated(p.owner, p.id, name, beneficiary, pricePerSecond, currency);
        if (redeploy) {
            redeployProduct(productId);
        }
    }

    function currentProductPrice(uint256 tokenId) public view returns(uint32, uint32, uint32, uint32) {
        return productPriceData(tokenId, block.timestamp);
    }

    /**
    *   get product data
    */
    function productPriceData(uint256 tokenId, uint256 targetDate) public view returns (uint32, uint32, uint32, uint32) {
        StoreData storage store = storeData[tokenId];
    
        uint256 startTimestamp = store.startTimestamp;
        uint256 endTimestamp = store.endTimestamp;
        uint256 clampedDate = Math.max(startTimestamp, Math.min(endTimestamp, targetDate));
        uint256 totalAgingDuration = endTimestamp - startTimestamp;
        uint256 elapsedDuration = clampedDate - startTimestamp;

        uint32 startPrice = store.startPriceUsd;
        uint32 endPrice = store.endPriceUsd;
        uint32 priceRange = endPrice - startPrice;
        uint32 additionalPrice = uint32(uint256(priceRange).mul(elapsedDuration).div(totalAgingDuration));
        uint32 currBottlePrice = store.startPriceUsd + additionalPrice;

        return (currBottlePrice, store.startPriceUsd, store.endPriceUsd, store.feesPerproductUsd);
    }


    /**
    * Changes ownership of the product. 
    */
    function offerProductOwnership(bytes32 productId, address newOwnerCandidate) public onlyProductOwner(productId) {
        _getProductDetails(productId);
        products[productId].newOwnerCandidate = newOwnerCandidate;
        emit ProductOwnershipOffered(products[productId].owner, productId, newOwnerCandidate);
    }

    /**
    * Changes ownership of the product. 
    */
    function claimProductOwnership(bytes32 productId) public onHold {
        _getProductDetails(productId);
        Product storage p = products[productId];
        require(msg.sender == p.newOwnerCandidate, "error_notPermitted");
        emit ProductOwnershipChanged(msg.sender, productId, p.owner);
        p.owner = msg.sender;
        p.newOwnerCandidate = address(0);
    }

    function hodle() public onlyOwner {
        hold = true;
        emit Holded();
    }

    function resume() public onlyOwner {
        hold = false;
        emit Resumed();
    }

    function purchase(uint amount, uint16 quantity) public payable {
        require(msg.sender != productBalance[amount], "cannot purchase product");
        
        (uint32 tokenPriceUsd, uint32 startPrice, uint32 endPrice, uint32 feePriceUsd) = productPriceData(amount, block.timestamp);
        uint256 paymentRequiredUSD = uint256(tokenPriceUsd + feePriceUsd).mul(quantity);
        uint256 usdToDmt = usdToDmtExchangeRate();
        emit UsdToDmt(usdToDmt);
        emit PaymentRequiredUSD(paymentRequiredUSD);

        uint256 dmtRequired = paymentRequiredUSD.mul(usdToDmt);
        emit Dmt(dmtRequired);
        require(msg.value >= dmtRequired, "Payment does not cover the price of the product.");
        digimart.transferFrom(msg.sender, address(this), dmtRequired);
        emit PurchaseSuccessful(msg.sender, dmtRequired);
    }

    function usdToDmtExchangeRate() internal view returns (uint256) {
       
        (, int256 usdToEthRate, , , ) = priceFeed.latestRoundData();
        uint8 rateDecimals = priceFeed.decimals();
        require(usdToEthRate > 0, "Cannot buy when rate is 0 or less.");
        uint256 usdToDmt = uint256(10 ** (rateDecimals - INTERNAL_PRICE_DECIMALS)).mul(1 ether).div(uint256(usdToEthRate));
        return usdToDmt;
    }

    function withdraw() public onlyOwner {
         uint balance = address(this).balance;
         _beneficiary.transfer(balance);
         emit Withdraw(balance);
  }
}
